package org.autonomous.functions;

import java.io.File;

import org.junit.Assert;
import org.junit.Test;

/**
 * Teste unitários para conversão de arquivos.
 * 
 * @author arthemus
 * @since 20/12/2013
 */
public class StreamTest {

	@Test
	public void converteArquivoComum() throws StreamException {
		File file = new File("src/test/resources/notaFiscalEletronica.xml");
		String arquivoConvertido = Stream.getBase64(file);
		Assert.assertNotNull(arquivoConvertido);
	}
	
	@Test
	public void retornaArquivoOriginal() throws StreamException {
		String base64 = "";
		File file = Stream.getFile(base64, "novaNotaFiscalComBaseNoStream.xml");
		Assert.assertNotNull(file);
	}
	
}
